import React from 'react';
import '../styles/Style.css';
import { useState } from 'react';

function Input(props) {
  const [values, setValues] = useState('');

  return (
    <div>
      <div>
        <h2>{props.symbol}</h2>
      </div>
      <fieldset>
        <input
          className={props.className}
          name={props.name}
          type="text"
          placeholder={props.placeholder}
          value={values}
        />
      </fieldset>
    </div>
  );
}

export default Input;
